import { motion } from 'framer-motion';
import React from 'react';
import { FaBriefcase, FaCalendarAlt, FaGraduationCap, FaMapMarkerAlt } from 'react-icons/fa';
import './Experience.css';

const Experience = () => {
  const workExperience = [
    {
      title: 'Senior Frontend Developer',
      company: 'Tech Company Inc.',
      location: 'San Francisco, CA',
      period: '2022 - Present',
      description: 'Led development of multiple web applications using React, TypeScript, and modern frontend technologies. Mentored junior developers and implemented best practices.',
      technologies: ['React', 'TypeScript', 'Node.js', 'AWS']
    },
    {
      title: 'Full Stack Developer',
      company: 'StartupXYZ',
      location: 'Remote',
      period: '2020 - 2022',
      description: 'Built and maintained web applications from concept to deployment. Worked closely with design and product teams to deliver high-quality user experiences.',
      technologies: ['React', 'Node.js', 'MongoDB', 'Express']
    },
    {
      title: 'Junior Developer',
      company: 'Digital Agency',
      location: 'New York, NY',
      period: '2019 - 2020',
      description: 'Developed responsive websites and web applications for various clients. Collaborated with designers and project managers to meet client requirements.',
      technologies: ['HTML', 'CSS', 'JavaScript', 'PHP']
    }
  ];

  const education = [
    {
      degree: 'Bachelor of Science in Computer Science',
      school: 'University of Technology',
      location: 'Boston, MA',
      period: '2015 - 2019',
      description: 'Graduated with honors. Focused on software engineering and web development. Completed capstone project on machine learning applications.'
    }
  ];

  return (
    <section id="experience" className="section experience">
      <div className="container">
        <motion.h2 
          className="section-title"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          Experience & Education
        </motion.h2>

        <motion.p 
          className="section-subtitle"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          My professional journey and academic background
        </motion.p>

        <div className="experience-content">
          <div className="experience-section">
            <motion.h3 
              className="section-heading"
              initial={{ opacity: 0, x: -30 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8, delay: 0.3 }}
              viewport={{ once: true }}
            >
              <FaBriefcase className="section-icon" />
              Work Experience
            </motion.h3>

            <div className="timeline">
              {workExperience.map((job, index) => (
                <motion.div 
                  key={index}
                  className="timeline-item"
                  initial={{ opacity: 0, y: 30 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8, delay: 0.4 + index * 0.1 }}
                  viewport={{ once: true }}
                >
                  <div className="timeline-marker"></div>
                  <div className="timeline-content">
                    <div className="job-header">
                      <h4 className="job-title">{job.title}</h4>
                      <div className="job-meta">
                        <span className="company">
                          <FaBriefcase /> {job.company}
                        </span>
                        <span className="location">
                          <FaMapMarkerAlt /> {job.location}
                        </span>
                        <span className="period">
                          <FaCalendarAlt /> {job.period}
                        </span>
                      </div>
                    </div>
                    <p className="job-description">{job.description}</p>
                    <div className="job-technologies">
                      {job.technologies.map((tech, techIndex) => (
                        <span key={techIndex} className="tech-tag">{tech}</span>
                      ))}
                    </div>
                  </div>
                </motion.div>
              ))}
            </div>
          </div>

          <div className="experience-section">
            <motion.h3 
              className="section-heading"
              initial={{ opacity: 0, x: -30 }}
              whileInView={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.8, delay: 0.5 }}
              viewport={{ once: true }}
            >
              <FaGraduationCap className="section-icon" />
              Education
            </motion.h3>

            <div className="timeline">
              {education.map((edu, index) => (
                <motion.div 
                  key={index}
                  className="timeline-item"
                  initial={{ opacity: 0, y: 30 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.8, delay: 0.6 + index * 0.1 }}
                  viewport={{ once: true }}
                >
                  <div className="timeline-marker education"></div>
                  <div className="timeline-content">
                    <div className="job-header">
                      <h4 className="job-title">{edu.degree}</h4>
                      <div className="job-meta">
                        <span className="company">
                          <FaGraduationCap /> {edu.school}
                        </span>
                        <span className="location">
                          <FaMapMarkerAlt /> {edu.location}
                        </span>
                        <span className="period">
                          <FaCalendarAlt /> {edu.period}
                        </span>
                      </div>
                    </div>
                    <p className="job-description">{edu.description}</p>
                  </div>
                </motion.div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Experience;
